// App.js
import React from 'react';
import StudentForm from './StudentForm';


const App = () => {
  return (
    <div>
      <h1>StudentApp2</h1>
      <StudentForm />
    </div>
  );
};

export { StudentForm }; // Exporting StudentForm component separately
export default App;
